import React, {useState, useEffect } from 'react';


const ValidateMission = ({ missions, onValidateMission }) => {
  const handleValidateMission = (mission) => {
    onValidateMission(mission);
  };

  return (
    <><div>
      Mission:
      name: localStorage.getItem('currentName')
    </div><table>
        <thead>
          <tr>
            <th>Mission Name</th>
            <th>Hours</th>
            <th>Volunteer Name</th>
            <th>Volunteer Address</th>
            <th></th>
          </tr>
        </thead>
        <tbody>
          {missions.map((mission, index) => (
            <tr key={index}>
              <td>{mission.name}</td>
              <td>{mission.hours}</td>
              <td>{mission.address}</td>
              <td>{mission.id}</td>
              <td>
                <button onClick={() => handleValidateMission(mission)}>Validate Mission</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table></>
  );
};

export default ValidateMission;
